import React, { useContext, useState } from 'react';
import './Add.css';
import Title from '../../components/title/Title';
import axios from 'axios';
import {toast} from 'react-toastify';
import {AdminContext} from '../../context/AdminContext';

const Add = () => {
  const {aToken} = useContext(AdminContext);
  const[data, setData] = useState({
    name: '',
    email: '',
    password:'',
    fees:'',
    about:'',
    degree:'',
    experience:'',
    speciality:'',
    adress:{
      adress1:'',
      adress2:''
    }
  })
  const[image, setImage] = useState(null);

  const onChangeHandler = (e)=>{
    const name = e.target.name;
    const value = e.target.value;
    setData((prev)=>({...prev, [name]:value}))
  }
  const onChangeAdress =(e)=>{
    const{name, value} = e.target;
    setData((prev)=>({...prev, adress:{...prev.adress, [name]:value} }))
  }

  const onSubmitHandler = async(e)=>{
    e.preventDefault();
    const formData = new FormData();
    const adress = JSON.stringify({
      address1: data.adress.adress1,
      address2: data.adress.adress2
    });
    formData.append('name', data.name);
    formData.append('email', data.email);
    formData.append('password', data.password);
    formData.append('fees', data.fees);
    formData.append('about', data.about);
    formData.append('experience', data.experience);
    formData.append('degree', data.degree);
    formData.append('speciality', data.speciality);
    formData.append('image', image);
    formData.append('adress', adress);

    const response = await axios.post('http://localhost:4000/api/admin/add-doctor', formData, {headers:{aToken}});
    if(response.data.success){
      toast.success(response.data.message);
      setData({
        name: '',
        email: '',
        password:'',
        fees:'',
        about:'',
        degree:'',
        experience:'',
        speciality:'',
        adress:{
          adress1:'',
          adress2:''
        }
      })
      setImage(false);
    }
    else{
      toast.error(response.data.message);
    }
  }
  return (
    <div className='add p-4'>
      <Title title='add doctor' />
      <form onSubmit={onSubmitHandler} className='p-5'>
        <div className='picture d-flex align-items-center gap-3 mb-4'>
          <div>
            <label for='upload'>
              {image ?
                <img src={URL.createObjectURL(image)}  alt=''/>:
                <i className="fa-solid fa-user p-4"></i>
              }
            </label>
            <input onChange={(e)=>setImage(e.target.files[0])} id='upload' type='file' hidden/>
          </div>
          <p>Upload doctor picture</p>
        </div>
        <div className='form-content d-flex gap-5'>
          <div className='input-container'>
            <div className='input mb-3'>
              <p className='mb-2'>your name</p>
              <input name='name' value={data.name} onChange={onChangeHandler} className='w-100 p-2' type='text' placeholder='name' required/>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>doctor email</p>
              <input name='email' value={data.email} onChange={onChangeHandler} className='w-100 p-2' type='email' placeholder='email' required/>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>set password</p>
              <input name='password' value={data.password} onChange={onChangeHandler} className='w-100 p-2' type='password' placeholder='password' required/>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>experience</p>
              <select name='experience' value={data.experience} onChange={onChangeHandler} className='w-100 p-2'>
                <option value="1 year">1 year</option>
                <option value="2 years">2 years</option>
                <option value="3 years">3 years</option>
                <option value="4 years">4 years</option>
                <option value="5 years">5 years</option>
                <option value="6 years">6 years</option>
                <option value="7 years">7 years</option>
                <option value="8 years">8 years</option>
                <option value="9 years">9 years</option>
                <option value="10 years">10 years</option>
              </select>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>fees</p>
              <input name='fees' value={data.fees} onChange={onChangeHandler} className='w-100 p-2' type='number' placeholder='doctor fees' required/>
            </div>
          </div>
          <div className='input-container'>
            <div className='input mb-3'>
              <p className='mb-2'>speciality</p>
              <select name='speciality' value={data.speciality} onChange={onChangeHandler} className='w-100 p-2'>
                <option value="general physician">general physician</option>
                <option value="gynecologist">gynecologist</option>
                <option value="dermatologist">dermatologist</option>
                <option value="pediatricians">pediatricians</option>
                <option value="neurologist">neurologist</option>
                <option value="gastroenterologist">gastroenterologist</option>
              </select>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>degree</p>
              <input name='degree' value={data.degree} onChange={onChangeHandler} className='w-100 p-2' type='text' placeholder='degree' required/>
            </div>
            <div className='input mb-3'>
              <p className='mb-2'>address</p>
              <input name='adress1' value={data.adress.adress1} onChange={onChangeAdress} className='w-100 p-2 mb-2' type='text' placeholder='address 1'/>
              <input name='adress2' value={data.adress.adress2} onChange={onChangeAdress} className='w-100 p-2' type='text' placeholder='address 2'/>
            </div>
          </div>
        </div>
        <div className='input mb-3'>
          <p className='mb-2'>about doctor</p>
          <textarea name='about' value={data.about} onChange={onChangeHandler} rows='5' className='w-100 p-2' placeholder='write about doctor'></textarea>
        </div>
        <button type='submit' className='p-2'>Add doctor</button>
      </form>
    </div>
  )
}

export default Add
